  <MDBTable className="mt-5">
    <MDBTableHead>
      <tr>
        <th>ID</th>
        <th>Hash Value</th>
        <th>Description</th>
        <th>Actions</th>
      </tr>
    </MDBTableHead>
    <MDBTableBody>
      {data.map((item) => (
        <tr key={item.id}>
          <td>{item.hash_value}</td>
          <td>{item.description}</td>
          <td>
            console.log("hola");
            {/* <MDBBtn color="warning" onClick={() => toggleModal("edit", item)}>
              Edit
            </MDBBtn>
            <MDBBtn color="danger" onClick={() => toggleModal("delete", item)}>
              Delete
            </MDBBtn> */}
          </td>
        </tr>
      ))}
    </MDBTableBody>
  </MDBTable>
);

export default DataTable;
